    axios.delete('http://localhost:8000/anime/' + _id)
    .then(res => {
      deleteAnime(_id);
      alert('deleted')
    })
  }
    return (

         <tr> 
              <td> <img src={anime.image} alt={anime.title} width="100px" /></td>
              <td>{anime.title} </td>
              <td> Price: {anime.rating}
              <Link to={'/items/edit/' + anime._id}>
                  <button >Edit Item</button>
              </Link></td>  
             <button onClick={()=>{deleteBtnClickHandler(anime._id)}}> x </button>                     
          </tr>





    )
}

